5ea717b6-cf86-44a0-aa93-06bd39d39d11	14002	14003	10180	10154	10874	Maximo Arano	2013-08-13 19:00:57.288	2013-08-13 19:01:55.279	0	0	14001	1	<?xml version='1.0' encoding='UTF-8'?><root available-locales="en_US" default-locale="en_US"><Title language-id="en_US">CartaOscar</Title></root>	cartaoscar		<?xml version="1.0"?>\n\n<root available-locales="en_US" default-locale="en_US">\n\t<static-content language-id="en_US"><![CDATA[<p style="text-align: justify;">\n\t<span style="font-size:16px;">Hello Everyone</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">We are "Neuli" and our target and mission is "<em>Aim for the Impossible to achieve the extraordinary</em>".</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;"><strong>How do we want to do that?</strong></span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">As a result of our experience and passions we have decided to do so by just taking our clients technological dreams and project manage them to reality.</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">Today we have discovered that there is a common interest within all out clients.</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">&nbsp;And that is .Easy!!!</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">Yes easy, they want things to be easier, a service company, real state, manufacturer, travel agency and many other SME they don't have enough budget to train the team members to use solutions that are already having a financial impact on the business.</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">Therefore we at Neuli are taking one step at a time to "Make it Easy".</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">So we are currently working extremely hard in to delivering the first concept of Lean CRM , the quickest and easiest way to keep a logs of all our clients information and status .</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">It is a Self-sufficient economical system that will help SME around the world. Not only will record but it will allowed a B2B real interactions, not just between people but between business personalities.</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">Because business around the world sometimes forget that we need to be out there to be heard, we need to be loud to be seen and we need to be organize to compete.</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">We are committed to grow with our SME and Micro enterprises clients, therefore we are planning for the initial users to be free and hopefully their usage and feedback will allow us to learn, grow and become something bigger than a CRM .</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">We want to be a whispering trusty advisor in B2B relations and business Growth.</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">Hope to hear from all your ideas and feedback soon</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">Oscar Omegna</span></p>\n<p style="text-align: justify;">\n\t<span style="font-size:16px;">El presi@ Neuli</span></p>]]></static-content>\n</root>	general				2013-08-13 18:57:00	\N	\N	t	f	14004		0	10874	Maximo Arano	2013-08-13 19:01:55.279	0	/0/
