29ac7062-c79a-4b43-8b45-feb06510a584	31816	0	0		2015-02-06 12:26:59.883	2015-02-06 12:26:59.883	21793045	Liferay Log Viewer	This plugin provides a portlet that attaches to the Liferay Portal's log4j mechanism to provide a log view within the browser.The portlet is available under Server in the Control Panel in 6.1, and under the Apps section in the Control Panel in 6.2.The portlet polls the log buffer periodically (configurable) to update the page with the latest logs. You can also attach or detach the logger from the portal log4j.Two portal properties can be set:* permeance.log.viewer.autoattach to toggle whether the logger attaches automatically on startup, default "true".* permeance.log.viewer.pattern to configure the log4j pattern, default "%d{ABSOLUTE} %-5p [%c{1}:%L] %m%n"Plugin SecurityThis plugin comes with the PACL Security Manager disabled. However the list of PACL requirements to run this plugin in secure mode is available (commented out) in WEB-INF/liferay-plugin-package.properties. You can uncomment those entries to run the plugin in PACL secure mode.About Permeance:Permeance is a Liferay Platinum Partner servicing Australia and New Zealand.Permeance received the Liferay Community Excellence Award in 2012 and 2013 for our contributions to Liferay 6.1 and 6.2 testing; promoting Liferay in our region and our participation in general across the Liferay community.	Utility	http://www.liferay.com/web/guest/marketplace/-/mp/asset/icon/32251104	1.0.3
